package com.Manuel.Crypto.Crypto.repositories;



import com.Manuel.Crypto.Crypto.model.Pedido;

import com.Manuel.Crypto.Crypto.model.Usuario;

import org.springframework.data.jpa.repository.JpaRepository;

import org.springframework.data.jpa.repository.Query;

import org.springframework.stereotype.Repository;



import java.util.List;



@Repository

public interface PedidoRepository

        extends JpaRepository {



    @Query(

            value = "SELECT * FROM pedidos  ORDER BY Fecha_Compra",

            nativeQuery = true)

    public List getByName(String title);

}

package com.Manuel.Crypto.Crypto.model;



import javax.persistence.Column;

import javax.persistence.Entity;

import javax.persistence.Id;

import javax.persistence.Table;



@Entity

@Table(name="Direccion")

public class Direcci√≥n {

    @Id

    private String id;

    @Column(name="Ciudad", length=30)

    private String Ciudad;

    @Column(name="Localidad", length=30)

    private String Localidad;

    @Column(name="CP", length=30)

    private int CP;

    @Column(name="Calle", length=30)

    private String Calle;

    @Column(name="Numero", length=30)

    private int Numero;

    @Column(name="Puerta", length=30)

    private String Puerta;



}
